INSERT INTO website_projeto VALUES(1,'Gnos',NULL,'Sistema de monitoramento de perfis de redes sociais','2020-07-06','https://www.youtube.com/watch?v=TZQh6d7fH7o&t=2s','Gnos é um painel de monitoramento web, que faz analises de dados advindos das redes sociais para composição de indicadores. Visando aferir o impacto das postagens em um determinado grupo de usuários da rede social onde ocorreu a postagem, ele coleta um conjunto de informações e expõem na forma gráficos interativos, para facilitar a visualização por parte dos interessados em monitorar uma determinada pagina (perfil) de uma rede social.','images/gnos.png','','',1);
INSERT INTO website_projeto VALUES(2,'MinerJus',NULL,'Solução de apoio à classificação processual com uso de inteligência artificial','2020-04-06','http://comais.uft.edu.br','Ferramenta que classifica os assuntos dos processos judiciais no ato do cadastro da petição inicial, visando garantir maior corretude e celeridade na tramitação do processo eletrônico.','images/minerjus_resposta.png','images/minerjus_edited.jpg','',1);
INSERT INTO website_projeto VALUES(3,'SmartReview',NULL,'Sistema de clusterização de artigos científicos','2022-07-06','https://youtu.be/LiCRIzbzOvg','Sistema de clusterização de artigos científicos, para apoio no processo de revisão bibliográfica. Cria grupos de artigos científicos usando inteligência artificial, com base no contexto dos artigos.','images/smartReview_80azGU7.PNG','images/SmartRevew2_qGI5oXS.PNG','images/SmartReview3_9sAIhwE.PNG',1);
INSERT INTO website_projeto VALUES(4,'Detecção de Ervas Daninhas',NULL,'Sistema detecção e georrefereciamento de ervas daninhas.','2020-07-06','http://comais.uft.edu.br',replace('<p class="1CorpodeTexto" style="margin: 0cm;"><span style="mso-bidi-font-size: 12.0pt; line-height: 150%;">No combate a essas plantas invasoras, como por exemplo, capim amargoso, carrapicho e buva, s&atilde;o utilizados herbicidas qu&iacute;micos, muitas vezes com a pulveriza&ccedil;&atilde;o dos defensivos em toda extens&atilde;o do plantio, gerando aumento do custo de produ&ccedil;&atilde;o, poss&iacute;vel contamina&ccedil;&atilde;o ambiental e surgimento de ervas mais resistentes.</span></p>\n<p class="1CorpodeTexto" style="margin: 0cm;"><span style="mso-bidi-font-size: 12.0pt; line-height: 150%;">Neste contexto, buscando reduzir o uso de defensivos sem a perda de produtividade, a detec&ccedil;&atilde;o e localiza&ccedil;&atilde;o das ervas daninhas dentro do plantio s&atilde;o fundamentais para o uso mais inteligente e preciso desses agentes qu&iacute;micos. &Eacute; a partir dessas informa&ccedil;&otilde;es associadas &agrave; tecnologia que &eacute; poss&iacute;vel realizar uma pulveriza&ccedil;&atilde;o mais precisa e eficiente.</span></p>','\n',char(10)),'images/Captura_de_Tela_2021-11-17_as_20.27.41_tb70zJP.png','images/Captura_de_Tela_2021-11-17_as_20.27.26.png','',1);
INSERT INTO website_projeto VALUES(5,'Detecção de Bezerros',NULL,'Sistema de Detecção de Bezerros em piquetes','2020-07-06','http://comais.uft.edu.br','<p>Sistema capaz de detectar bezerros em espa&ccedil;os limitados, utilizando c&acirc;meras PTZ.</p>','images/5_detecção.jpg','images/Analise_de_KeyPoints.jpg','images/7_bezerroDetect.jpg',1);
INSERT INTO website_projeto VALUES(6,'Orgam Tracker',NULL,'Sistema de rastreamento de transporte de órgão humanos doados.','2020-07-06','http://comais.uft.edu.br','<p>Sistema, que por meio de informa&ccedil;&otilde;es de voos devidamente refinado,&nbsp;&eacute; capaz de rastrear e georreferenciar aeronaves que transportam &oacute;rg&atilde;o humanos para doa&ccedil;&atilde;o.</p>','images/Captura_de_tela_2021-11-03_184010.png','images/Captura_de_tela_2021-11-03_184755.png','images/Organ_tracker.png',1);
INSERT INTO website_projeto VALUES(7,'Analise Espacial Exploratória',NULL,'Índice de Governança Municipal','2020-07-06','http://comais.uft.edu.br','<p>Analise espacial do &nbsp;&Iacute;ndice de Governan&ccedil;a Municipal nos munic&iacute;pios do estado do Tocantins.</p>','images/Captura_de_tela_2024-02-29_091930.png','images/Captura_de_tela_2024-02-29_092030.png','images/Captura_de_tela_2023-04-11_103404.png',1);
