INSERT INTO website_projetorelatorio VALUES(2,'FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE INTELIGENCIA ARTIFICIAL','2023-01-18','2024-02-18',14,'<p><span style="font-size: 9.0pt; mso-bidi-font-size: 14.0pt; font-family: ''Arial'',sans-serif; mso-fareast-font-family: Arial; mso-ansi-language: PT-BR; mso-fareast-language: PT-BR; mso-bidi-language: AR-SA;">Capacita&ccedil;&atilde;o e forma&ccedil;&atilde;o em recursos humanos na &aacute;rea de Intelig&ecirc;ncia Artificial, com foco em Sistema de Recomenda&ccedil;&atilde;o, especialmente para estudantes de gradua&ccedil;&atilde;o e p&oacute;s-gradua&ccedil;&atilde;o que estejam cursando ou tenham cursado alguma gradua&ccedil;&atilde;o na &aacute;rea de tecnologia. Essa iniciativa visa contribuir com a amplia&ccedil;&atilde;o da inova&ccedil;&atilde;o e o desenvolvimento do setor brasileiro de IA e </span><span style="font-size: 9.0pt; font-family: ''Arial'',sans-serif; mso-fareast-font-family: Arial; mso-ansi-language: PT-BR; mso-fareast-language: PT-BR; mso-bidi-language: AR-SA; layout-grid-mode: line;">contribuir para a inova&ccedil;&atilde;o e estreitamento da rela&ccedil;&atilde;o Academia-Ind&uacute;stria</span></p>','<p><span style="font-size: 9.0pt; font-family: ''Arial'',sans-serif; mso-fareast-font-family: Arial; mso-ansi-language: PT-BR; mso-fareast-language: PT-BR; mso-bidi-language: AR-SA;">Desenvolvimento de aplica&ccedil;&atilde;o em Intelig&ecirc;ncia Artificial e Sistema de Recomenda&ccedil;&atilde;o</span></p>','',1,0,'Em andamento','2023-01-05 19:15:53.000000',1,NULL);
INSERT INTO website_projetorelatorio VALUES(4,'Central QualiTOPAMA - Qualificação das Ações de Vigilância em Saúde, Fortalecimento e Organização da Rede de Saúde Interfederativa','2023-03-01','2024-02-24',12,'<p><span style="font-size: 11.0pt; line-height: 107%; font-family: ''Calibri'',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: PT-BR; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">Coordenar e supervisionar os servi&ccedil;os contratados para consecu&ccedil;&atilde;o das metas previstas no campo da interven&ccedil;&atilde;o tecnol&oacute;gica; assessorar a Coordena&ccedil;&atilde;o Geral quanto ao monitoramento e avalia&ccedil;&atilde;o do desenvolvimento das a&ccedil;&otilde;es previstas no campo da interven&ccedil;&atilde;o tecnol&oacute;gica.</span></p>','<p><span style="font-size: 11.0pt; line-height: 107%; font-family: ''Calibri'',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: PT-BR; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">MONITORAMENTO E AVALIA&Ccedil;&Atilde;O da solu&ccedil;&atilde;o tecnol&oacute;gica em desenvolvimento.&nbsp;</span></p>','',1,0,'Em andamento','2023-03-02 09:45:37.432083',1,NULL);
INSERT INTO website_projetorelatorio VALUES(5,'Formação em recursos humanos na área de Inteligência Artificial, com foco em Sistema de Recomendação','2023-02-10','2024-02-10',12,'<p>O projeto visa o desenvolvimento de capacita&ccedil;&atilde;o e forma&ccedil;&atilde;o&nbsp;em recursos humanos na &aacute;rea de Intelig&ecirc;ncia Artificial, com foco em Sistema&nbsp;de Recomenda&ccedil;&atilde;o, especialmente para estudantes de gradua&ccedil;&atilde;o e p&oacute;s-gradua&ccedil;&atilde;o que estejam cursando ou tenham cursado alguma gradua&ccedil;&atilde;o na&nbsp;&aacute;rea de tecnologia. Essa iniciativa visa contribuir com a amplia&ccedil;&atilde;o da&nbsp;inova&ccedil;&atilde;o e o desenvolvimento do setor brasileiro de IA e contribuir para a&nbsp;inova&ccedil;&atilde;o e estreitamento da rela&ccedil;&atilde;o Academia-Ind&uacute;stria.</p>','<p>Forma&ccedil;&atilde;o de 50 alunos na &aacute;rea de intelig&ecirc;ncia artificial e&nbsp;desenvolvimento de um sistema de recomenda&ccedil;&atilde;o</p>','',20,0,'Em andamento','2023-09-26 14:12:21.883796',1,'<p>Criar testes dos endpoints;<br>Melhorar o Backend do m&oacute;dulo GPT;<br>Melhorar os endpoints;<br>Melhorar os serializadores;<br>Melhorar as regras de neg&oacute;cio;<br>Melhorar os Admins;<br>Melhorar as views.</p>');
INSERT INTO website_projetorelatorio VALUES(7,'Formação em recursos humanos na área de Inteligência Artificial, com foco em Sistema de Recomendação','2023-09-06','2024-02-10',6,'<p>O projeto visa o desenvolvimento de capacita&ccedil;&atilde;o e forma&ccedil;&atilde;o em recursos humanos na &aacute;rea de Intelig&ecirc;ncia Artificial, com foco em Sistema de Recomenda&ccedil;&atilde;o, especialmente para estudantes de gradua&ccedil;&atilde;o e p&oacute;s-gradua&ccedil;&atilde;o que estejam cursando ou tenham cursado alguma gradua&ccedil;&atilde;o na &aacute;rea de tecnologia. Essa iniciativa visa contribuir com a amplia&ccedil;&atilde;o da inova&ccedil;&atilde;o e o desenvolvimento do setor brasileiro de IA e contribuir para a inova&ccedil;&atilde;o e estreitamento da rela&ccedil;&atilde;o Academia-Ind&uacute;stria.</p>','<p>Forma&ccedil;&atilde;o de 50 alunos na &aacute;rea de intelig&ecirc;ncia artificial e desenvolvimento de um sistema de recomenda&ccedil;&atilde;o</p>','templates/modelo_formulario_9_-_Relatorio_mensal_bolsista_1.docx',21,0,'Em andamento','2024-02-01 13:06:42.419668',0,'<p>Capacita&ccedil;&atilde;o de 50 alunos em intelig&ecirc;ncia artificial com &ecirc;nfase em sistema de recomenda&ccedil;&atilde;o.</p>');
INSERT INTO website_projetorelatorio VALUES(8,'Governança Digital e Modelagem Computacional para a Prestação Jurisdicional no TRE-GO','2024-03-01','2025-01-31',9,'<p>Execu&ccedil;&atilde;o do Projeto &ldquo;GOVERNAN&Ccedil;A DIGITAL E MODELAGEM COMPUTACIONAL PARA A PRESTA&Ccedil;&Atilde;O JURISDICIONAL ELEITORAL NO TRE-GO&rdquo;, visando ampliar o espa&ccedil;o de investiga&ccedil;&atilde;o cient&iacute;fica, o interc&acirc;mbio de a&ccedil;&otilde;es e de projetos t&eacute;cnico-cient&iacute;ficos entre os professores-pesquisadores da UFT e os servidores e colaboradores, vinculados ao Programa de P&oacute;s-gradua&ccedil;&atilde;o em Modelagem Computacional de Sistemas (Mestrado e Doutorado) e, tamb&eacute;m com pesquisadores de universidades brasileiras e internacionais.</p>','<p>Promover um curso on-line de Explora&ccedil;&atilde;o de Dados com Pandas, visando equipar pesquisadores com habilidades em an&aacute;lise de dados, fundamentais para o desenvolvimento de pesquisas em Governan&ccedil;a Digital e Modelagem Computacional. Fomentar a publica&ccedil;&atilde;o conjunta de artigos cient&iacute;ficos e trabalhos t&eacute;cnicos que contribuam para o avan&ccedil;o do conhecimento na &aacute;rea de governan&ccedil;a digital</p>','',1,1,'Em andamento','2024-04-01 13:29:47.200789',1,'<p>Desenvolvimento e oferta do curso on-line de Explora&ccedil;&atilde;o de Dados com Pandas, incluindo m&oacute;dulos desde a introdu&ccedil;&atilde;o ao Python e Pandas at&eacute; t&eacute;cnicas avan&ccedil;adas de an&aacute;lise de dados. Certificados de conclus&atilde;o para os participantes do curso de Explora&ccedil;&atilde;o de Dados com Pandas. Organiza&ccedil;&atilde;o de sess&otilde;es de mentorias para orientar os participantes na elabora&ccedil;&atilde;o e desenvolvimento de projetos de pesquisa</p>');
INSERT INTO website_projetorelatorio VALUES(9,'FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE INTELIGENCIA ARTIFICIAL','2024-03-13','2025-05-31',18,'<p><span style="font-size: 11.0pt; mso-bidi-font-size: 12.0pt; font-family: ''Arial'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-ansi-language: PT-BR; mso-fareast-language: PT-BR; mso-bidi-language: AR-SA; mso-bidi-font-weight: bold;">Forma&ccedil;&atilde;o de n&uacute;cleos de pesquisa com participa&ccedil;&atilde;o da academia (professores-pesquisadores) e do sistema de sa&uacute;de (alunos- profissionais) para o desenvolvimento de a&ccedil;&otilde;es de pesquisa, que propiciem a amplia&ccedil;&atilde;o da produtividade acad&ecirc;mica do corpo docente do Programa de P&oacute;s-Gradua&ccedil;&atilde;o em Modelagem Computacional de Sistemas, realizado em parceria com o Minist&eacute;rio da Sa&uacute;de/UFT, e a consolida&ccedil;&atilde;o da produtividade cient&iacute;fica na &aacute;rea de governan&ccedil;a e modelagem computacional de dados em sa&uacute;de, numa perspectiva e abordagem interdisciplinar.</span></p>','<p><span style="font-size: 11.0pt; mso-bidi-font-size: 12.0pt; font-family: ''Arial'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-ansi-language: PT-BR; mso-fareast-language: PT-BR; mso-bidi-language: AR-SA; mso-bidi-font-weight: bold;">Promover um cursos on-line de na &aacute;rea de intelig&ecirc;ncia artificial, visando equipar pesquisadores com habilidades em an&aacute;lise de dados, fundamentais para o desenvolvimento de pesquisas em Governan&ccedil;a Digital e Modelagem Computacional. Fomentar a publica&ccedil;&atilde;o conjunta de artigos cient&iacute;ficos e trabalhos t&eacute;cnicos que contribuam para o avan&ccedil;o do conhecimento na &aacute;rea de governan&ccedil;a digital</span></p>','',1,0,'Em andamento','2024-04-01 13:44:12.614808',1,'<p><span style="font-size: 11.0pt; mso-bidi-font-size: 12.0pt; font-family: ''Arial'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: ''Times New Roman''; mso-ansi-language: PT-BR; mso-fareast-language: PT-BR; mso-bidi-language: AR-SA; mso-bidi-font-weight: bold;">Desenvolvimento e oferta do curso on-line de Aprendizado de M&aacute;quina com Python, incluindo m&oacute;dulos desde a introdu&ccedil;&atilde;o a Machine Learning e Processamento de Linguagem Natural at&eacute; t&eacute;cnicas avan&ccedil;adas de desenvolvimento de produtos de dados. Certificados de conclus&atilde;o para os participantes dos cursos. Organiza&ccedil;&atilde;o de sess&otilde;es de mentorias para orientar os participantes na elabora&ccedil;&atilde;o e desenvolvimento de projetos de pesquisa</span></p>');
INSERT INTO website_projetorelatorio VALUES(10,'Modelagem Computacional e Tecnologias Educacionais para a Secretaria da Educação do Estado do Tocantins','2024-02-01','2025-08-01',17,'<p>Concep&ccedil;&atilde;o de um n&uacute;cleo de professores com alto n&iacute;vel de capacita&ccedil;&atilde;o&nbsp;em Tecnologias Educacionais.</p>','<p>Realizar atividades de computa&ccedil;&atilde;o aplicada &agrave; Educa&ccedil;&atilde;o para fins Educacionais,&nbsp;utilizando tecnologias da informa&ccedil;&atilde;o e comunica&ccedil;&atilde;o.</p>','',22,0,'Em andamento','2024-04-01 14:02:54.394293',1,'<p>Pesquisa e desenvolvimento em Governan&ccedil;a Digital e Tecnologias Educacionais. Apoio aos professores e alunos na prepara&ccedil;&atilde;o de aulas&nbsp;de Rob&oacute;tica Educional.</p>');
INSERT INTO website_projetorelatorio VALUES(11,'Governaça Digital no Ministério da Saúde','2024-05-01','2024-12-01',12,'<p>Forma&ccedil;&atilde;o de n&uacute;cleos de pesquisa com participa&ccedil;&atilde;o da academia (professores-pesquisadores) e do&nbsp;sistema de sa&uacute;de (alunos- profissionais) para o desenvolvimento de a&ccedil;&otilde;es de pesquisa, que&nbsp;propiciem a amplia&ccedil;&atilde;o da produtividade acad&ecirc;mica do corpo docente do Programa de P&oacute;s-Gradua&ccedil;&atilde;o em Modelagem Computacional de Sistemas, realizado em parceria com o Minist&eacute;rio da&nbsp;Sa&uacute;de/UFT, e a consolida&ccedil;&atilde;o da produtividade cient&iacute;fica na &aacute;rea de governan&ccedil;a e modelagem<br>computacional de dados em sa&uacute;de, numa perspectiva e abordagem interdisciplinar.</p>','<p>Dar suporte no desenvolvimento de cursos online na &aacute;rea de intelig&ecirc;ncia artificial que visam equipar os pesquisadores com habilidades em an&aacute;lise de dados, fundamentando o desenvolvimento de pesquisas em Governan&ccedil;a Digital e Modelagem Computacional. Auxililar a fomentar a publica&ccedil;&atilde;o conjunta de artigos cinet&iacute;ficos e trabalhos t&eacute;cnicos que&nbsp;contribuam para o avan&ccedil;o do conhecimento em governan&ccedil;a digital</p>','',22,0,'Em andamento','2024-06-04 16:00:07.741758',1,'<p>Relat&oacute;rio T&eacute;cnico Conclusivo ao final do projeto.</p>');
INSERT INTO website_publicacao VALUES(1,'RESUMO AUTOMÁTICO DE TEXTOS JURÍDICOS USANDO GRAFOS COM VOCABULÁRIO CONTROLADO E ALGORITMO K-MEANS C',replace('<p>O processo judicial eletr&ocirc;nico &eacute; uma realidade no Brasil, onde 70% dos casos novos em todo Poder Judici&aacute;rio s&atilde;o virtuais. Fazer uso adequado desta realidade e aprimor&aacute;-lo &eacute; primordial para dar vaz&atilde;o &agrave; demanda de aproximadamente 25 milh&otilde;es de processos novos por ano. Neste contexto, buscar facilitar o dia a dia dos operadores da justi&ccedil;a brasileira, respons&aacute;veis pelas an&aacute;lises do crescente volume de informa&ccedil;&atilde;o digital presentes nos autos &eacute; primordial para a efici&ecirc;ncia na presta&ccedil;&atilde;o jurisdicional e amplo acesso &agrave; justi&ccedil;a. Usar resumos textos &eacute; uma forma &aacute;gil de se inteirar sobre o assunto do texto, podendo ser um meio de empregar maior agilidade &agrave; tramita&ccedil;&atilde;o processual. Assim esta pesquisa, visa o desenvolvimento de uma ferramenta capaz de gerar automaticamente resumos de textos jur&iacute;dicos, fazendo uso de t&eacute;cnicas de Processamento de Linguagem Natural e teoria de grafos em conjunto com o vocabul&aacute;rio jur&iacute;dico advindo do Supremo Tribunal Federal.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','\n',char(10)),2020,'SOUSA, ROGÉRIO NOGUEIRA DE; PRATA, DAVID NADLER','artigos/RTP-01.docx','2022-08-03 12:58:39.000000',1);
INSERT INTO website_publicacao VALUES(2,'Robot Chow: Automatic Animal Feeding with Intelligent Interface to Monitor Pets.','<p>De acordo com &uacute;ltima pesquisa do IBGE, existem mais de 74,3 milh&otilde;es de c&atilde;es e gatos no Brasil, e o maior custo na cria&ccedil;&atilde;o desses animais &eacute; com a ra&ccedil;&atilde;o, devendo ser servida em hor&aacute;rios e quantidades adequadas. Contrapondo isso, no cotidiano dos criadores de animais de estima&ccedil;&atilde;o, n&atilde;o raramente ocorrem imprevistos como reuni&otilde;es, viagens de &uacute;ltima hora, engarrafamento no tr&acirc;nsito, entre outros. Com o prop&oacute;sito de auxiliar &agrave;s dificuldades postas aos criadores de animais dom&eacute;sticos de pequeno porte, este trabalho apresenta a implanta&ccedil;&atilde;o de uma solu&ccedil;&atilde;o denominada RoboBoia, capaz de servir ra&ccedil;&atilde;o granulada e troca de &aacute;gua em hor&aacute;rios e volume pr&eacute;-agendados de acordo com o usu&aacute;rio, podendo monitorar se o mesmo est&aacute; se alimentando. Para isso, o usu&aacute;rio usa mensagens instant&acirc;neas no celular, tendo uma interface de solu&ccedil;&atilde;o que controla as funcionalidades apenas interagindo (&ldquo;conversando&rdquo;) com o aplicativo. A solu&ccedil;&atilde;o al&eacute;m de proporcionar comandos, permite enviar fotos ou ainda notificar se algo est&aacute; fora do normal. Isto, independente de espa&ccedil;o-tempo, bastando apenas acesso &agrave; internet. A solu&ccedil;&atilde;o foi toda desenvolvida em Raspberry pi, usando Python, e integrado aos servi&ccedil;os em nuvem Watson Assistent e Telegram.</p>',2019,'NOGUEIRA, ROGERIO; ARAÚJO, HUMBERTO ; PRATA, DAVID .','artigos/RTP-02_zhwNr7H.pdf','2022-08-03 13:05:55.000000',1);
INSERT INTO website_publicacao VALUES(3,'MINERJUS: SOLUTION TO THE PROCESSUAL CLASSIFICATION WITH USE OF ARTIFICIAL INTELLIGENCE','<p>The electronic judicial process isa reality in Brazil, where 70% of the new cases in all judicialpower are virtual, making proper use of this reality and improving it is paramount to give a flow tothe demand of approximately 25 million new cases per year. This project proposes an improvementin the electronic processes, through the use of Artificial Intelligence, to assist legal operatorsresponsible for registering the initial petition document (creation of the process), as well as thoseresponsible for the analysis, through automatic and assertive suggestion to the subject of theprocess, printing greater agility of procedure and quality in the information contained in theBrazilian judicial records</p>',2019,'NOGUEIRA, ROGERIO; PRATA, DAVID ;RAMOS, J. D. A.','','2022-12-19 15:26:01.074346',1);
INSERT INTO website_publicacao VALUES(4,'Geospatial Dimension in Association Rule Mining: The Case Study of the Amazon Charcoal Tree','<p>Despite the potential of association rules to extract knowledge in datasets, the<br>selection of valuable rules has been the specialists&rsquo; big challenge because of the great<br>number of rules generated by association rules&rsquo; algorithms. Unfortunately, for Species<br>Distribution Modeling, researchers and analysts alike has been discourage regarding the<br>efficacy and relative merits to the studies due to the conflicting of results. In this case<br>study, we integrate geoprocessing techniques with association rules to analyze the<br>potential distribution of the charcoal tree species of Amazon, Tachigali Subvelutina. This<br>integration allowed the exploration of a new method to select valuable association rules<br>based not only by frequent item sets, like confidence, support and lift. But also considering<br>the geospatial distribution of the species occurrences. The application of one more<br>dimensional to the measures of the frequent item sets provides a more effective<br>understanding and adequate amount of relevance to represent significant association rules.<br>Further, this new approach can support experts to: identify effective rules, i.e., rules that<br>can be effective used with regression techniques to predict species in geospatial<br>environments; identify variables that play a decisive role to discover the occurrence of<br>species; and evaluate the effectivity of the datasets used for the study to answer the<br>specified scientific questions.</p>',2020,'SOUSA, ROGÉRIO NOGUEIRA DE; PRATA, DAVID NADLER; ROCHA, MARCELO L.; FERREIRA, LEANDRO O.','','2022-12-19 15:30:48.000000',1);
INSERT INTO website_publicacao VALUES(5,'UMA REDE SOCIAL CONSTRUÍDA A PARTIR DE DOCUMENTOS DIGITAIS DO PORTAL DA UNIVERSIDADE FEDERAL DE TOCA',replace('Esta pesquisa propõem a exemplificação de um mapeamento de uma rede social. Desata forma, nesta\npesquisa, reproduziu-se uma rede social de entes relacionados à Universidade Federal do Tocantins (UFT) por meio do uso de 13 mil documentos digitais. Para mapear as conexões dos documentos e gerar o grafo, foi utilizado como critério que caso o nome de duas pessoas estejam em um mesmo documento eles possuem uma conexão, para cada arquivo diferente que houver conexão, esta relação é fortalecida. O grafo apresentou 114.405 vértices, e 21.081.984 arestas. Dos dez nós de maior centralidade, os entes encontrados ocuparam, ou ainda ocupam as seguintes funções: reitor, diretor de campus, pró-reitor e vice-reitor. Dessa forma, considera-se a reprodução de uma rede complexa de relacionamentos, com a utilização de documentos digitais como uma alternativa viável para o mapeamento de interações sociais de núcleos que provavelmente não estão mapeados pelas redes sociais online convencionais. Assim, o grafo criado por esse modelo de rede social, construída a partir de documentos digitais de texto, apresenta uma alternativa para mapear relações entre entes,  podendo ter diversas finalidades.','\n',char(10)),2023,'NOGUEIRA, ROGERIO;  PRATA, DAVID ; BARBOSA, GENTIL;MURTA,RAFAEL;SILVA, ELENCARLOS','','2023-08-08 15:43:50.000000',1);
