INSERT INTO website_relatorio VALUES(27,'<p>Foi criado o protocolo para entrega de produtos da empresa contratada, visando garantir que o produto entregue pela empresa tenha total ader&ecirc;ncia ao produto<br>contratado.</p>','<p>Os artefatos necess&aacute;rios para entrega dos produtos s&atilde;o divididos em: &nbsp;Lista usu&aacute;rios<br>cadastrados, Capacita&ccedil;&otilde;es dos usu&aacute;rios, Documenta&ccedil;&atilde;o do sistema e Relat&oacute;rio de teste em<br>campo do sistema</p>',3,1,'','2022-05-30','2022-05-30','docs/3-2022-05-30-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(28,replace('<p>Resultado obtido. Est&aacute; sendo acompanhado algumas atualiza&ccedil;&otilde;es a serem realizadas no sistema<br>de vigil&acirc;ncia sanit&aacute;ria, que s&atilde;o:</p>\n<p>Relat&oacute;rio de todas as situa&ccedil;&otilde;es por setor cadastradas e que eventualmente venham a ser<br>cadastradas;<br>Relat&oacute;rio das empresas cadastradas e exclu&iacute;das mensalmente;<br>Relat&oacute;rio das empresas que possuem pendencias nas assinaturas;<br>Relat&oacute;rio de visita por dia por setor e por t&eacute;cnico;<br>Relat&oacute;rio do quantitativo de empresas licenciadas mensalmente por setor e por atividade;<br>Adequa&ccedil;&atilde;o na licen&ccedil;a sanit&aacute;ria haja visto que algumas licen&ccedil;as, principalmente as<br>drogarias, necessitam de carimbos, conforme foto abaixo:<br>Adequa&ccedil;&atilde;o no relat&oacute;rio consulta de estabelecimento, acrescentar CNPJ para ficar mais<br>f&aacute;cil a consulta;<br>Relat&oacute;rio que demonstre quem fez altera&ccedil;&atilde;o em um processo, quem inativou, quem<br>excluiu etc;<br>Adequa&ccedil;&atilde;o no tamanho dos arquivos anexados, tendo em vista que possuem processo em<br>que s&oacute; o contrato social atinge uns 20MB. Dentro da possibilidade verificar o tamanho<br>m&aacute;ximo.</p>','\n',char(10)),'',4,1,'','2022-06-30','2022-06-30','docs/4-2022-06-30-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(29,'<p>Resultado obtido. O munic&iacute;pio de Marab&aacute; realizou a checagem das novas funcionalidades<br>implantadas no sistema de vigil&acirc;ncia sanit&aacute;ria, e certificou que as funcionalidades abaixo<br>atendem a expectativa:<br> Lista dos operadores que exclu&iacute;ram Documentos, Processos, Visitas...<br> Permitir digitar o per&iacute;odo da visita do operador;<br> Especifica&ccedil;&atilde;o do Bairro a ser visitado;<br> Lista de CNPJ de outros munic&iacute;pios;<br><br></p>','',5,1,'','2022-07-30','2022-07-30','docs/5-julho-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(30,replace('<p>Resultados obtidos.&nbsp; Entre os dias 24/08/2022 e 27/08/2022, foi realizada visita t&eacute;cnica nos municipios de Itupiranga, Marab&aacute; e Rondon do Par&aacute;,&nbsp; na ocasi&atilde;o foi definido que o munic&iacute;pio de Marab&aacute; ter&aacute; prioridade na implanta&ccedil;&atilde;o de todos os sistemas contratados, devido ao fato de ser o munic&iacute;pio mais avan&ccedil;ado no processo de implanta&ccedil;&atilde;o das ferramentas.</p>\n<p>O sistema de Vigil&acirc;ncia Sant&aacute;ria&nbsp; est&aacute; conclu&iacute;ndo o processo de implanta&ccedil;&atilde;o, restando apenas a valida&ccedil;&atilde;o em campo do mesmo.</p>\n<p>&nbsp;</p>','\n',char(10)),'',6,1,'','2022-09-06','2022-08-31','docs/6-2022-08-31-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(31,replace('<p class="card-text text-break">Resultado:</p>\n<p>Resultados obtidos.&nbsp; O sistema de apoio aos Agentes de Controle de Endemias come&ccedil;ou a ser implantado no municipio de Rondon do Par&aacute;, todos os agentes cadastrados e devidamente treinados, passando a operar com tablets na coleta de informa&ccedil;&atilde;o durante as visitas. Os agentes realizaram os primeiros testes em campo.</p>\n<p>&nbsp;No municipio de Itupiranga&nbsp; tambem est&aacute; sendo implantado o sistema para os ACE, os cadastros e treinamentos j&aacute; foram realizados.</p>','\n',char(10)),'',7,1,'','2022-10-06','2022-09-30','docs/7-setembro-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(32,'<p>O modulo de sa&uacute;de da mulher entrou na fase de testes junto a secretaria municipal de saude no munic&iacute;pio de Marab&aacute; no dia 15/10/2022, na ocasi&atilde;o fora disponibilizado o banco de dados do e-sus, para que se podesse gerar os indicadores de sa&uacute;de da mulher. Tambem foi realizado o treinamento dos coordenadores das unidades de aten&ccedil;&atilde;o basica de sa&uacute;de no municipio em tela.</p>','',8,1,'','2022-11-08','2022-10-31','docs/8-outubro-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(33,replace('<p class="MsoNormal">Implanta&ccedil;&atilde;o no estado do Tocantins come&ccedil;ou pelo munic&iacute;pio de Anan&aacute;s , que optou pela implanta&ccedil;&atilde;o do sistema de apoio aos agentes de endemias, foi realizado o devido treinamento dos agentes e gestores&nbsp;do munic&iacute;pio em tela.</p>\n<p class="MsoNormal">Outra a&ccedil;&atilde;o foi inicio das tratativas de implanta&ccedil;&atilde;o das solu&ccedil;&otilde;es do projeto no munic&iacute;pio de A&ccedil;ail&acirc;ndia no Maranh&atilde;o.</p>','\n',char(10)),'',9,1,'','2022-12-04','2022-11-30','docs/9-novembro-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(34,'<p>O processo de implanta&ccedil;&atilde;o dos sistemas Apoio a controle de endemias e Vigil&acirc;ncia sanit&aacute;ria, foi realizado no munic&iacute;pio de Piraqu&ecirc;, com apresenta&ccedil;&atilde;o dos sistemas, cadastro dos operadores e treinamento dos usu&aacute;rios.&nbsp;</p>','',10,1,'','2023-01-02','2022-12-31','docs/10-dezembro-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(36,'<p>Conclus&atilde;o da forma&ccedil;ao de equipe e defini&ccedil;&atilde;o quanto &agrave; arquitetura do sistema que ser&aacute; desenvolvido no ambito do projeto</p>','',1,2,'','2023-02-02','2023-01-31','docs/1-janeiro-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(39,replace('<p>Defini&ccedil;&atilde;o da ferramenta basilar para instrutoria e elabora&ccedil;&atilde;o do escopo inicial do desenvolvimento do sistema.</p>\n<p>O ambiente Jina.ai ser&aacute; utilizado para cria&ccedil;&atilde;o de uma plaforma experimental e ser&aacute; criado um gerador de Plano de Trabalho para responder as demandas apresentadas pelas empresas demandantes.</p>','\n',char(10)),'',2,2,'','2023-03-02','2023-02-28','docs/2-fevereiro-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(41,'<p>Realiza&ccedil;&atilde;o do levamento e apresenta&ccedil;&atilde;o da solu&ccedil;&atilde;o tecnol&oacute;gica a ser implantada nos munic&iacute;pios de Angico, Davin&oacute;polis, Araguan&atilde;, Luzin&oacute;polis, Estreito, Tocantin&oacute;polis, Porto Franco e Amarante.<br>Durante as visitas presenciais, foram detectadas algumas situa&ccedil;&otilde;es que possam dificultar o processo de implanta&ccedil;&atilde;o dos sistemas, como a falta de equipamentos moveis, para os sistemas que apresentam essa necessidade, e a exist&ecirc;ncia de sistemas(pagos) j&aacute; implantado em alguns munic&iacute;pios.&nbsp;<br><br></p>','<p>Cabe salientar que, todos munic&iacute;pios visitados, possuem os requisitos necess&aacute;rios para a implanta&ccedil;&atilde;o de pelo menos uma das solu&ccedil;&otilde;es propostas pelo projeto.</p>',1,4,'','2023-03-02','2023-02-28','docs/1-fevereiro-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(43,'<p><span style="font-size: 11.0pt; line-height: 107%; font-family: ''Calibri'',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: PT-BR; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">Levantamento de requisitos para o sistema de gera&ccedil;&atilde;o de plano de trabalho, com as funcionalidades b&aacute;sica para o sistema de recomenda&ccedil;&atilde;o. Solicita&ccedil;&atilde;o de aquisi&ccedil;&atilde;o de equipamentos como notebook e workstation.</span></p>','',3,2,'','2023-04-03','2023-03-31','docs/3-março-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(44,'<p><span style="font-size: 11.0pt; line-height: 107%; font-family: ''Calibri'',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Cambria; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: PT-BR; mso-fareast-language: EN-US; mso-bidi-language: AR-SA; mso-bidi-font-weight: bold;">Elabora&ccedil;&atilde;o da</span><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 11.0pt; line-height: 107%; font-family: ''Calibri'',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Cambria; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: PT-BR; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"> </span></strong><span style="font-size: 11.0pt; line-height: 107%; font-family: ''Calibri'',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Cambria; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: PT-BR; mso-fareast-language: EN-US; mso-bidi-language: AR-SA; mso-bidi-font-weight: bold;">agenda de implanta&ccedil;&atilde;o dos sistemas para os munic&iacute;pios, Angico, Luzin&oacute;polis, Araguan&atilde; e Santa F&eacute;. Tamb&eacute;m foi criado os v&iacute;deos de apresenta&ccedil;&atilde;o dos sistemas que est&atilde;o sendo implantados, pelo projeto QualiTopama.</span></p>','',2,4,'','2023-04-17','2023-03-31','',NULL);
INSERT INTO website_relatorio VALUES(45,'<p>Reuni&otilde;es semanais com a defini&ccedil;&atilde;o do modelo de desenho das telas do sistema de gera&ccedil;&atilde;o de plano de trabalho, conclus&atilde;o do modulo de gest&atilde;o de usu&aacute;rios e arquiterua do front-end.Tambem foram adiquiridos&nbsp; 03(tr&ecirc;s) computadores do tipo desktop.</p>','',4,2,'','2023-05-02','2023-04-30','docs/4-abril-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(46,replace('<p>Instala&ccedil;&atilde;o ambiente de treinamento moodle com protocolo do seguran&ccedil;a SSL, o ambiente visa a implatan&ccedil;&atilde;o do curso para atividades assincronas, onde os alunos ter&atilde;o acesso aos materiais para capacita&ccedil;&atilde;o.&nbsp;</p>\n<p>No sistema em desenvolvimento fora definida como ser&aacute; o processo de implanta&ccedil;&atilde;o das abas de gest&atilde;o de recursos dos projetos.&nbsp;</p>','\n',char(10)),'',5,2,'','2023-06-01','2023-05-31','docs/5-maio-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(47,'<p>Implementa&ccedil;&atilde;o da nuvem para acomodar a aplica&ccedil;&atilde;o desenvolvida, aquisi&ccedil;&atilde;o de nobreak, instala&ccedil;&atilde;o dos sistemas da workstation, defini&ccedil;&atilde;o do layout do treinamento do modulo python.</p>','',6,2,'','2023-07-02','2023-06-30','docs/6-junho-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(48,'<p>Reuni&otilde;es de monitoramento do projeto, segunda presenta&ccedil;&atilde;o de contas do projeto de forma&ccedil;&atilde;o, implatan&ccedil;&atilde;o de melhorias no sistema e suporte ao desenvolvimento de conte&uacute;dos para o curso de forma&ccedil;&atilde;o.</p>','',7,2,'','2023-08-01','2023-07-31','docs/7-julho-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(49,replace('<p>Lan&ccedil;amento da incri&ccedil;&atilde;o para o curso m&oacute;dulo <span class="OYPEnA">M&oacute;dulo Python do curso de IA com foco em Sistemas de Recomenda&ccedil;&atilde;o. Participa&ccedil;&atilde;o em entrvistas na TV local para apresenta&ccedil;&atilde;o do curso. Reuni&otilde;es para defini&ccedil;&atilde;o de formato das aulas telepresenciais. Incio das aulas previstas para o dia 04 de setembro.</span></p>\n<div class="DF_utQ _0xkaeQ">\n<div class="Zp7NQw">\n<div class="a26Xuw">\n<div class="PcHy7w">\n<div class="uk_25A Ty61NA">&nbsp;</div>\n</div>\n</div>\n</div>\n</div>','\n',char(10)),'',8,2,'','2023-09-01','2023-08-31','docs/8-agosto-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(50,'<p>Testes para os endpoints criados;<br>Backend melhorado;<br>Modelo de dados do GPT melhorado e regras ajustadas;<br>Serializadores melhorados;<br>Endpoints melhorados e com otimiza&ccedil;&atilde;o na integra&ccedil;&atilde;o com o frontend&nbsp;React;<br>Admins e views melhorados.</p>','',1,5,'','2023-09-26','2023-08-31','docs/1-agosto-Formação em recursos humanos na área de .docx',NULL);
INSERT INTO website_relatorio VALUES(51,replace('<p>Acompanhamento das a&ccedil;&otilde;es do curso M&oacute;dulo Python do curso de IA como foco em sistemas de recomenda&ccedil;&atilde;o, com participa&ccedil;&otilde;es nas aulas s&iacute;ncronas, e acompanhamento das demandas que surgem no Telegram.&nbsp; Foram abertas as inscri&ccedil;&otilde;es para o curso, que tem como objetivo fornecer uma base s&oacute;lida em Python, abrangendo desde conceitos fundamentais at&eacute; t&oacute;picos avan&ccedil;ados, como manipula&ccedil;&atilde;o de dados e express&otilde;es regulares. A &ecirc;nfase principal est&aacute; na aplica&ccedil;&atilde;o pr&aacute;tica desses conhecimentos na cria&ccedil;&atilde;o de Sistemas de Recomenda&ccedil;&atilde;o.<br>Inicialmente, foram disponibilizadas 100 vagas para participantes, mas com o sucesso da divulga&ccedil;&atilde;o, a demanda foi maior do que o previsto. Assim, optamos por triplicar o n&uacute;mero de vagas, matriculando 300 alunos.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','\n',char(10)),'',9,2,'','2023-10-02','2023-09-30','docs/9-setembro-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(52,'<p>asdfasd</p>','<p>asdfasdf</p>',3,4,'','2023-10-17','2023-09-30','docs/3-setembro-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(53,replace('<p>Realizando os procedimentos de certifica&ccedil;&atilde;o dos alunos aprovados no curso :&nbsp;<a href="https://sistemas.uft.edu.br/gpu/admin/app/acao/6821/show">M&Oacute;DULO PYTHON - SISTEMAS DE RECOMENDA&Ccedil;&Atilde;O INTELIGENTE,</a> com a gera&ccedil;&atilde;o do relat&oacute;rio parcial do projeto de extens&atilde;o Forma&ccedil;&atilde;o de recursos humanos na &aacute;rea de Intelig&ecirc;ncia Artificial, com foco em Sistema de Recomenda&ccedil;&atilde;o.</p>\n<p>Onde dos 300 alunos que se inscreveram no curso, 225 deram in&iacute;cio &agrave;s aulas. Isso equivale a uma impressionante taxa de participa&ccedil;&atilde;o inicial de75%. Evidencia-se, assim, que uma parcela significativa dos alunos est&aacute; demonstrando comprometimento desde o in&iacute;cio do curso. Dos alunos que iniciaram o curso, 140 deles atingiram a nota necess&aacute;ria para a certifica&ccedil;&atilde;o at&eacute; a presente data. Isso equivale a 62,2% dos participantes que come&ccedil;aram o curso. Esse n&uacute;mero demonstra um desempenho s&oacute;lido por parte dos alunos que est&atilde;o se dedicando ao curso.</p>\n<p>&nbsp;</p>','\n',char(10)),'',10,2,'','2023-10-31','2023-10-31','docs/10-outubro-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(54,replace('<p>No m&ecirc;s de novembro, o projeto focou no desenvolvimento e alinhamento t&eacute;cnico do M&oacute;dulo II. Reuni&otilde;es t&eacute;cnicas e executivas semanais foram essenciais para superar desafios e assegurar progresso. Em 06/11/2023, a reuni&atilde;o t&eacute;cnica abordou diverg&ecirc;ncias no livro-refer&ecirc;ncia do projeto Softex e progressos na produ&ccedil;&atilde;o de material did&aacute;tico. Uma estrat&eacute;gia proposta envolveu a aplica&ccedil;&atilde;o de sistemas em datasets de filmes e xWine para uma compreens&atilde;o pr&aacute;tica dos conceitos.</p>\n<p>Em 16/11/2023, a equipe discutiu melhorias na configura&ccedil;&atilde;o do software OBS, compartilhando pr&aacute;ticas eficazes e considerando mudan&ccedil;as para otimizar as aulas. No encontro de 23/11/2023, houve avan&ccedil;o nas etapas do projeto, com destaque para a implementa&ccedil;&atilde;o do sistema e prepara&ccedil;&atilde;o dos slides, marcando a prontid&atilde;o para iniciar grava&ccedil;&otilde;es do M&oacute;dulo II.</p>\n<p>Discuss&otilde;es no Telegram inclu&iacute;ram o in&iacute;cio das grava&ccedil;&otilde;es do M&oacute;dulo II e a partilha de t&eacute;cnicas para aumentar a reten&ccedil;&atilde;o do aluno em v&iacute;deos, envolvendo etapas como "The Hook", "The Transition", "Self-introduction" e "Audience Benefit". Alexandre compartilhou progressos na implementa&ccedil;&atilde;o de conceitos do livro de Kim Falk, incluindo aplica&ccedil;&otilde;es do algoritmo SVD e t&eacute;cnicas de redu&ccedil;&atilde;o de dimensionalidade.</p>\n<p>A reestrutura&ccedil;&atilde;o do conte&uacute;do para o M&oacute;dulo II, baseando-se nas aprendizagens do M&oacute;dulo I, reflete um comprometimento com adapta&ccedil;&atilde;o e melhoria cont&iacute;nua, trazendo avan&ccedil;os significativos em v&aacute;rios aspectos do curso.</p>','\n',char(10)),'',11,2,'','2023-12-01','2023-11-30','docs/11-novembro-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(55,replace('<p>Inicio das tratativas para M&oacute;dulo II, com defini&ccedil;&atilde;o de conte&uacute;do e cadastro do curso no sitema de gest&atilde;o de curso da UFT, outra a&ccedil;&atilde;o relevante foi a aquisi&ccedil;&atilde;o de todos equipamentos previsto no projeto, como a TV iterativa de 75 polegadas, tamb&eacute;m no periodo fora solicitado o aditamente de prazo do projeto.</p>\n<p>Outros equipamentos adquiridos:</p>\n<p style="padding-left: 40px;">Sony C&acirc;mera mirrorlessAlpha A6600<br>SanDisk Cart&atilde;o 128 GBExtreme<br>Sony SELP18105G E PZ 18- 105mm F4 G OSS<br>VILTROX 13mm f/1.4 F1.4 E-Mount APS-C Lens, Ultra WideAngle Autofocus Prime Lens<br>Gaiola para c&acirc;mera SonyAlpha A6600/ILCE 6600 Mirrorless com suportes de sapato frio<br>Desktops"Workstation Precision, com<br>placa de v&iacute;deo 12GB"<br>Monitor Dell Touch Screen 4K de 75<br>Monitores 24&rsquo;&rsquo;<br>Monitores 4k, 27&rdquo;<br>Notebook para desenvolvimento com processador de 4 ou 6 n&uacute;cleos&nbsp;"Notebook Com placa de&nbsp;v&iacute;deos"<br>Workstation em torre Precision<br>HD SSD 2tb<br>HD SSD NVME 1TB<br>Kit Memoria 128gb , sem ECC, (4x32GB)Nobreak Senoidal 8kva&nbsp;</p>\n<p style="padding-left: 40px;">Memoria com ECC 32 GB DDR4 SDRAM, 2666 MHz<br>Monitor Led 31,5&rdquo; 4k<br>Webcam 4k<br>Dell M.2 SSD m&oacute;dulo para&nbsp;FlexBay incl. bracket<br>Notebook com sistema iOS</p>\n<p style="padding-left: 40px;">Nobreak senoidal</p>','\n',char(10)),'',12,2,'','2024-01-02','2023-12-31','docs/12-dezembro-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(56,'<p>Os ajustes no plano de utiliza&ccedil;&atilde;o e nas presta&ccedil;&otilde;es de contas foram realizados com sucesso. Paralelamente, iniciou-se um novo m&oacute;dulo do curso "Sistema de Recomenda&ccedil;&otilde;es". Esta etapa incluiu o cadastro do curso junto &agrave; Universidade Federal do Tocantins, um passo fundamental para possibilitar a emiss&atilde;o de certificados. Al&eacute;m disso, as inscri&ccedil;&otilde;es para o referido curso foram abertas, marcando o come&ccedil;o de uma nova fase educacional. Este processo assegura uma estrutura organizada e oficial para o curso, garantindo sua qualidade e reconhecimento acad&ecirc;mico.</p>','',13,2,'','2024-02-01','2024-01-31','docs/13-janeiro-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(58,'<p>No m&ecirc;s de Janeiro, foram iniciados os preparos para a entrega do segundo m&oacute;dulo do curso de Intelig&ecirc;ncia Artificial com foco em Sistemas de Recomenda&ccedil;&atilde;o. Foi criada a sala no Google Classroom, os conte&uacute;dos foram organizados e os alunos foram convidados. Al&eacute;m disso, foi prestado aux&iacute;lio ao curso de Explora&ccedil;&atilde;o de Dados com Pandas, com suporte aos alunos, organiza&ccedil;&atilde;o e entrega de conte&uacute;dos (aulas e apostilas) e participa&ccedil;&atilde;o como monitor em aulas s&iacute;ncronas. Foram tamb&eacute;m realizadas atividades de desenvolvimento na ferramenta de gerenciamento de cursos ministrados pelo laborat&oacute;rio no Google Classroom.</p>','',5,7,'','2024-02-06','2024-02-06','docs/5-fevereiro-Formação em recursos humanos na área de .docx',NULL);
INSERT INTO website_relatorio VALUES(59,'<p>O curso foi estruturado para abordar desde conceitos b&aacute;sicos at&eacute; t&eacute;cnicas avan&ccedil;adas, com &ecirc;nfase em exerc&iacute;cios pr&aacute;ticos para aplica&ccedil;&atilde;o direta do aprendizado.Estamos alimentado&nbsp; a plataforma Google Classroom para facilitar o acesso aos materiais e promover a intera&ccedil;&atilde;o, complementada por aulas ao vivo e um grupo no Whatsapp, incentivando uma comunidade ativa de aprendizado.</p>','<p>--</p>',1,8,'','2024-04-01','2024-03-01','docs/1-março-Governança Digital e Modelagem Computaci.docx',NULL);
INSERT INTO website_relatorio VALUES(60,'<p>At&eacute; agora, para o curso de Machine Learning, planejamos abordar os fundamentos te&oacute;ricos e pr&aacute;ticos essenciais, come&ccedil;ando com uma introdu&ccedil;&atilde;o &agrave; an&aacute;lise de dados usando Python. Exploramos como manipular s&eacute;ries e DataFrames com Pandas, cobrindo t&eacute;cnicas para sele&ccedil;&atilde;o de dados, tratamento de valores faltantes e m&eacute;todos de agrupamento para prepara&ccedil;&atilde;o e entendimento dos dados. Essas habilidades s&atilde;o cruciais para a etapa de pr&eacute;-processamento de dados em projetos de Machine Learning. Al&eacute;m disso, destacamos a import&acirc;ncia de visualizar e entender os dados antes de aplicar algoritmos de aprendizado de m&aacute;quina, estabelecendo uma base s&oacute;lida para avan&ccedil;armos para conceitos mais complexos de modelagem e avalia&ccedil;&atilde;o de algoritmos, garantindo assim que os participantes estejam bem preparados para implementar e otimizar modelos de Machine Learning de forma eficaz.</p>','<p>--</p>',1,9,'','2024-04-01','2024-03-31','docs/1-março-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(61,'<p>sdfbghsdfghsdfg</p>','<p>sdfghdfgh</p>',4,4,'','2024-04-01','2024-03-31','docs/4-março-Central QualiTOPAMA - Qualificação das A.docx',NULL);
INSERT INTO website_relatorio VALUES(62,'<p>Foi dada continua&ccedil;&atilde;o a pesquisa iniciada no &uacute;ltimo relat&oacute;rio. Tamb&eacute;m feita an&aacute;lise dos documentos coletados com auxilio&nbsp;dos professores.</p>','<p>--</p>',2,10,'','2024-04-01','2024-03-31','docs/2-março-Modelagem Computacional e Tecnologias Ed.docx',NULL);
INSERT INTO website_relatorio VALUES(63,'<p>Foi feito o auxilio aos professores com o processo de sele&ccedil;&atilde;o do edital. Al&eacute;m da separa&ccedil;&atilde;o do material pesquisado para alinhamento com os professores.</p>','',3,10,'','2024-05-01','2024-04-01','docs/3-abril-Modelagem Computacional e Tecnologias Ed.docx',NULL);
INSERT INTO website_relatorio VALUES(64,replace('<p>At&eacute; o momento, estamos em fase de desenvolvimento dos materiais para o curso de Machine Learning. Este processo envolve a elabora&ccedil;&atilde;o de conte&uacute;do did&aacute;tico detalhado e a estrutura&ccedil;&atilde;o do curso na plataforma Google Classroom. Estamos comprometidos em fornecer recursos educacionais de alta qualidade que facilitar&atilde;o o aprendizado efetivo dos alunos.</p>\n<p>&nbsp;</p>','\n',char(10)),'<p>--</p>',2,9,'','2024-05-02','2024-04-30','docs/2-abril-GOVERNANÇA DIGITAL NO MINISTÉRIO DA SAÚD.docx',NULL);
INSERT INTO website_relatorio VALUES(65,'<p>Adicionamos ao curso um m&oacute;dulo extra que consiste em um minicurso de Python, com o objetivo de proporcionar aos alunos uma base s&oacute;lida em programa&ccedil;&atilde;o, essencial para o aproveitamento completo das funcionalidades da biblioteca pandas. Este minicurso abrange desde os conceitos b&aacute;sicos de Python at&eacute; aspectos mais avan&ccedil;ados, como estruturas de dados e controle de fluxo, garantindo que todos os participantes tenham as habilidades necess&aacute;rias para manipular dados eficientemente.</p>','<p>--</p>',2,8,'','2024-05-02','2024-04-01','docs/2-abril-Governança Digital e Modelagem Computaci.docx',NULL);
INSERT INTO website_relatorio VALUES(66,'<p>O curso de machine learning foi iniciado, sendo ministradas as aulas intrudut&oacute;rias de conceitos de Machine Learning e manipula&ccedil;&atilde;o de dados com Pandas.&nbsp;</p>','<p>--</p>',3,9,'','2024-06-03','2024-05-31','docs/3-maio-GOVERNANÇA DIGITAL NO MINISTÉRIO DA SAÚD.docx',NULL);
INSERT INTO website_relatorio VALUES(67,'<p>Foram realizadas aulas pr&aacute;ticas que utilizaram dados reais para demonstrar a explora&ccedil;&atilde;o de dados na pr&aacute;tica. Durante essas sess&otilde;es, os alunos tiveram a oportunidade de trabalhar com conjuntos de dados aut&ecirc;nticos, aplicando t&eacute;cnicas de an&aacute;lise e visualiza&ccedil;&atilde;o para extrair informa&ccedil;&otilde;es relevantes. Essas aulas visaram proporcionar uma compreens&atilde;o mais profunda e pr&aacute;tica dos conceitos te&oacute;ricos, capacitando os alunos a lidar com dados do mundo real.</p>','<p>--</p>',3,8,'','2024-06-03','2024-05-31','docs/3-maio-Governança Digital e Modelagem Computaci.docx',NULL);
INSERT INTO website_relatorio VALUES(68,'<p>Realizei pesquisa em modelagem computacional e intelig&ecirc;ncia artificial, levantei e analisei conte&uacute;dos sobre modelagem computacional e intelig&ecirc;ncia artificial, incluindo artigos cient&iacute;ficos, livros, tutoriais e materiais online. Testei o material levantado utilizando diferentes m&eacute;todos, como revis&atilde;o por pares, avalia&ccedil;&atilde;o de especialistas e testes pr&aacute;ticos. Meu objetivo era preparar e auxiliar os professores na realiza&ccedil;&atilde;o das aulas, fornecendo-lhes materiais did&aacute;ticos de alta qualidade e atividades pr&aacute;ticas relevantes.</p>','',4,10,'','2024-06-01','2024-05-31','docs/4-maio-Modelagem Computacional e Tecnologias Ed.docx',NULL);
INSERT INTO website_relatorio VALUES(69,'<p>Auxilio no desenvolvimento da interface online dos cursos de Aprendizado de Maquina com Python, automatiza&ccedil;&atilde;o de envio de emails, cadastro da turma e auxilio no desenvolvimento das aulas.</p>','',1,11,'','2024-06-04','2024-05-31','docs/1-maio-Governaça Digital no Ministério da Saúde.docx',NULL);
INSERT INTO website_relatorio VALUES(70,replace('<p>Foi ministrado, dentro do curso de Machine Learning, um m&oacute;dulo espec&iacute;fico de Tratamento e An&aacute;lise de Dados, focado em fornecer aos alunos as habilidades necess&aacute;rias para pr&eacute;-processar, limpar e analisar grandes volumes de dados. Este m&oacute;dulo incluiu t&eacute;cnicas de imputa&ccedil;&atilde;o de valores ausentes, normaliza&ccedil;&atilde;o de dados, detec&ccedil;&atilde;o e tratamento de outliers, e m&eacute;todos avan&ccedil;ados de visualiza&ccedil;&atilde;o de dados.</p>\n<p>Os alunos aprenderam a utilizar ferramentas e bibliotecas populares, como Pandas, NumPy e Matplotlib, para manipula&ccedil;&atilde;o e visualiza&ccedil;&atilde;o de dados. Al&eacute;m disso, o m&oacute;dulo abordou a import&acirc;ncia da engenharia de caracter&iacute;sticas e da sele&ccedil;&atilde;o de vari&aacute;veis para melhorar a performance dos modelos de Machine Learning.</p>','\n',char(10)),'<p>***</p>',4,9,'','2024-07-01','2024-06-30','docs/4-junho-GOVERNANÇA DIGITAL NO MINISTÉRIO DA SAÚD.docx',NULL);
INSERT INTO website_relatorio VALUES(71,'<p>Continuamos a realizar aulas pr&aacute;ticas utilizando dados reais para demonstrar a explora&ccedil;&atilde;o de dados na pr&aacute;tica. Durante essas sess&otilde;es, os alunos t&ecirc;m a oportunidade de trabalhar com conjuntos de dados aut&ecirc;nticos, aplicando t&eacute;cnicas de an&aacute;lise e visualiza&ccedil;&atilde;o para extrair informa&ccedil;&otilde;es relevantes. Essas aulas visam proporcionar uma compreens&atilde;o mais profunda e pr&aacute;tica dos conceitos te&oacute;ricos, capacitando os alunos a lidar com dados do mundo real.</p>','<p>***</p>',4,8,'','2024-07-01','2024-06-01','docs/4-junho-Governança Digital e Modelagem Computaci.docx',NULL);
INSERT INTO website_relatorio VALUES(72,replace('<p class="card-text text-break">Resultado:</p>\n<p>Foi ministrado, dentro do curso de Machine Learning, um m&oacute;dulo espec&iacute;fico de gera&ccedil;ao de modelos de&nbsp; Machine Learning, e analise de desenpenho, os alunos focaram no aprendizado do processo de avalia&ccedil;&atilde;o de modelos.</p>','\n',char(10)),'<p>--</p>',5,9,'','2024-08-02','2024-07-31','docs/5-julho-GOVERNANÇA DIGITAL NO MINISTÉRIO DA SAÚD.docx',NULL);
INSERT INTO website_relatorio VALUES(73,'<p>Continuamos&nbsp; selecionando conjuntos de dados variados e planejando aulas pr&aacute;ticas detalhadas. Com acesso &agrave;s ferramentas necess&aacute;rias e com demonstra&ccedil;&otilde;es pr&aacute;ticas. Com intera&ccedil;&otilde;es, avalia&ccedil;&atilde;o do progressos, integrando teoria e pr&aacute;tica.</p>','<p>--</p>',5,8,'','2024-08-02','2024-07-01','docs/5-julho-Governança Digital e Modelagem Computaci.docx',NULL);
INSERT INTO website_relatorio VALUES(74,'<p>Conclu&iacute;mos o curso de Machine Learning e agora estamos trabalhando no relat&oacute;rio final. Neste relat&oacute;rio, abordaremos os principais desafios enfrentados e as oportunidades identificadas ao longo do curso. Al&eacute;m disso, incluiremos uma avalia&ccedil;&atilde;o detalhada com base no feedback fornecido pelos alunos participantes.</p>','<p>--</p>',6,9,'','2024-08-30','2024-08-30','docs/6-agosto-GOVERNANÇA DIGITAL NO MINISTÉRIO DA SAÚD.docx',NULL);
INSERT INTO website_relatorio VALUES(75,'<p>Estamos em processo de teste do gerador de ambiente de virtal de aprendizado, a solu&ccedil;ao est&aacute; sendo implantada em um servidor com placa de video de grande porte visando promover maior capacidade de processamentos por GPU para os alunos.</p>','<p>--</p>',14,2,'','2024-09-30','2024-09-30','docs/14-setembro-FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',NULL);
INSERT INTO website_relatorio VALUES(76,'<p>O curso de Processamento de Linguagem Natural est&aacute; em andamento durante o m&ecirc;s de setembro, com aulas focadas no uso da ferramenta spaCy para processamento de linguagem natural (PLN). As aulas aprofundaram os conceitos ministrados anteriormente e inclu&iacute;ram a instala&ccedil;&atilde;o da ferramenta, a cria&ccedil;&atilde;o de um ambiente de desenvolvimento local e a explora&ccedil;&atilde;o das funcionalidades do spaCy.</p>','<p>--</p>',7,9,'','2024-10-01','2024-09-30','docs/7-setembro-GOVERNANÇA DIGITAL NO MINISTÉRIO DA SAÚD.docx',NULL);
INSERT INTO website_relatorio VALUES(77,'<p>Durante o m&ecirc;s de outubro, o curso de Processamento de Linguagem Natural se concentrou no trabalho com Large Language Models (LLM), explorando suas capacidades e aplica&ccedil;&otilde;es em tarefas complexas de PLN. As aulas foram dedicadas a aprofundar o uso desses modelos avan&ccedil;ados, abordando sua implementa&ccedil;&atilde;o, treinamento e otimiza&ccedil;&atilde;o, proporcionando aos participantes uma compreens&atilde;o mais rica e pr&aacute;tica das t&eacute;cnicas de processamento de linguagem com modelos de &uacute;ltima gera&ccedil;&atilde;o.</p>','<p>--</p>',8,9,'','2024-11-01','2024-10-31','docs/8-outubro-GOVERNANÇA DIGITAL NO MINISTÉRIO DA SAÚD.docx',NULL);
INSERT INTO website_relatoriofinal VALUES(1,replace('<p class="MsoNormal">A agenda de implanta&ccedil;&atilde;o dos sistemas nos munic&iacute;pios de Marab&aacute;, Itupiranga, Bom Jesus do Tocantins, Rondom do Par&aacute;, Dom Eliseu, S&atilde;o Domingos do Araguaia, Anan&aacute;s, Angico, Augustin&oacute;polis, Carmol&acirc;ndia, Luzin&oacute;polis, Piraqu&ecirc;, Santa F&eacute; do Araguaia, Tocantin&oacute;polis, A&ccedil;ail&acirc;ndia, Amarante do Maranh&atilde;o, Itinga do Maranh&atilde;o, Jo&atilde;o Lisboa e Porto Franco, foi conclu&iacute;da com &ecirc;xito, marcando um objetivo significativo alcan&ccedil;ado. Adicionalmente, alcan&ccedil;amos outro marco importante com a produ&ccedil;&atilde;o e divulga&ccedil;&atilde;o de v&iacute;deos de apresenta&ccedil;&atilde;o para os sistemas que est&atilde;o sendo implementados no projeto QualiTopama.</p>\n<p class="MsoNormal">Durante os anos de 2023 e 24, <span style="mso-spacerun: yes;">&nbsp;</span>v&aacute;rias cidades da regi&atilde;o Interfederativa do Bico do Papagaio atingiram melhorias expressivas devido &agrave; implementa&ccedil;&atilde;o e ao treinamento eficaz nos Sistemas de Vigil&acirc;ncia Sanit&aacute;ria, ACE e Sa&uacute;de da Mulher, integrantes do programa Previne Brasil. Este sucesso foi particularmente not&aacute;vel nas cidades de Marab&aacute;, Itupiranga, Brejo Grande do Araguaia, S&atilde;o Domingos do Araguaia, Bom Jesus do Tocantins, Tocantin&oacute;polis, Piraqu&ecirc;, Carmol&acirc;ndia e Santa F&eacute; do Araguaia, todas beneficiadas por visitas t&eacute;cnicas presenciais de nossas equipes.</p>\n<p class="MsoNormal">Estas visitas permitiram a avalia&ccedil;&atilde;o e confirma&ccedil;&atilde;o do sucesso na instala&ccedil;&atilde;o das solu&ccedil;&otilde;es tecnol&oacute;gicas, al&eacute;m de identificar e superar quaisquer desafios surgidos p&oacute;s-implanta&ccedil;&atilde;o. O progresso no treinamento das ferramentas tamb&eacute;m foi revisado e validado como bem-sucedido.</p>','\n',char(10)),'<p class="MsoNormal">Salientamos o sucesso na implementa&ccedil;&atilde;o das solu&ccedil;&otilde;es tecnol&oacute;gicas, que ocorreu ap&oacute;s a assinatura do termo de coopera&ccedil;&atilde;o entre as prefeituras e a UFT, com a ACONE plenamente ciente e envolvida no processo. Apesar de cada prefeitura apresentar seu pr&oacute;prio ritmo nos procedimentos administrativos, o que por vezes prolongou os prazos, conseguimos superar estes desafios e evitar atrasos significativos no cronograma. Este fato ressalta a efici&ecirc;ncia e a adaptabilidade tanto do nosso processo de acompanhamento e monitoramento quanto da log&iacute;stica da empresa contratada.&nbsp;</p>','<p>A compara&ccedil;&atilde;o entre os resultados esperados e os alcan&ccedil;ados no projeto indica alta satisfa&ccedil;&atilde;o. Superamos nosso objetivo inicial de implementar sistemas na regi&atilde;o interfederativa do TOPAMA, adicionando v&iacute;deos explicativos que ampliaram o alcance do projeto. Nas cidades da regi&atilde;o Interfederativa do Bico do Papagaio, as melhorias foram not&aacute;veis, gra&ccedil;as &agrave; eficiente implementa&ccedil;&atilde;o dos sistemas de sa&uacute;de. As visitas t&eacute;cnicas confirmaram o sucesso da instala&ccedil;&atilde;o e do treinamento. Apesar dos desafios administrativos, as solu&ccedil;&otilde;es foram instaladas a tempo, superando as expectativas e refletindo a efic&aacute;cia do projeto.</p>','<p>.</p>','<p>As conclus&otilde;es extra&iacute;das deste projeto indicam um sucesso not&aacute;vel. Superamos os objetivos iniciais com a eficiente implementa&ccedil;&atilde;o de sistemas nos munic&iacute;pios selecionados, complementada pela cria&ccedil;&atilde;o de materiais informativos que expandiram o impacto e a visibilidade do projeto. Observamos um impacto positivo consider&aacute;vel nas cidades da regi&atilde;o Interfederativa do Bico do Papagaio, onde as melhorias na sa&uacute;de p&uacute;blica foram significativas. As visitas t&eacute;cnicas se revelaram fundamentais para a avalia&ccedil;&atilde;o e o treinamento eficazes, assegurando que as metas de implementa&ccedil;&atilde;o e capacita&ccedil;&atilde;o fossem alcan&ccedil;adas. Apesar dos desafios administrativos variados enfrentados em diferentes prefeituras, o projeto conseguiu instalar as solu&ccedil;&otilde;es tecnol&oacute;gicas dentro dos prazos previstos, demonstrando uma capacidade not&aacute;vel de adapta&ccedil;&atilde;o e supera&ccedil;&atilde;o de obst&aacute;culos. Em resumo, o projeto n&atilde;o apenas atendeu, mas em muitos aspectos, superou as expectativas, refletindo seu sucesso e efic&aacute;cia.</p>','2023-12-31','2024-01-17','','docs/Relatorio_final - Central QualiTOPAMA - Qualificação das A.docx',4);
INSERT INTO website_relatoriofinal VALUES(2,replace('<p>O projeto tinha como objetivo principal a forma&ccedil;&atilde;o de 50 alunos em intelig&ecirc;ncia artificial com &ecirc;nfase em sistema de recomenda&ccedil;&atilde;o. Nos trabalhos realizados durante o primeiro m&oacute;dulo do curso, que introduziu os alunos &agrave; linguagem Python, 140 alunos obtiveram resultados satisfat&oacute;rios e receberam certificados de conclus&atilde;o do m&oacute;dulo. Portanto, durante o per&iacute;odo de vig&ecirc;ncia da bolsa, os objetivos principais foram alcan&ccedil;ados, contando com os trabalhos no suporte ao funcionamento e disponibiliza&ccedil;&atilde;o dos conte&uacute;dos e materiais no Google Classroom e suporte aos alunos nos processos relacionados a matr&iacute;culas, avalia&ccedil;&otilde;es e d&uacute;vidas em geral sobre o curso.</p>\n<p>Al&eacute;m do curso de Intelig&ecirc;ncia Artificial com foco em Sistemas de Recomenda&ccedil;&atilde;o, foram obtidos resultados em outros cursos disponibilizados pelo laborat&oacute;rio. Prestou-se aux&iacute;lio na disponibiliza&ccedil;&atilde;o de conte&uacute;dos, no processo de avalia&ccedil;&atilde;o, tira-d&uacute;vidas, prepara&ccedil;&atilde;o de apostilas e as aulas dadas no curso de Explora&ccedil;&atilde;o de Dados com Pandas, disponibilizado para alunos interessados do IFTO, para alunos interessados do curso de Intelig&ecirc;ncia Artificial com foco em Sistemas de Recomenda&ccedil;&atilde;o, como conte&uacute;do complementar, e para servidores do Tribunal Regional Eleitoral de Goi&aacute;s.</p>\n<p>Fora isso, foram obtidos resultados em atividades de desenvolvimento requisitadas pelo laborat&oacute;rio. Os requisitos para o in&iacute;cio de futuros desenvolvimentos de servi&ccedil;os prestados no website Comais foram atendidos, tendo em vista que o projeto foi organizado para funcionamento adequado na m&aacute;quina local. Tamb&eacute;m tem sido desenvolvidas funcionalidades de automa&ccedil;&atilde;o para as atividades educacionais do laborat&oacute;rio, no processo de matr&iacute;cula e apoio aos alunos, visando aumentar a praticidade e efic&aacute;cia no gerenciamento dos cursos e alavancar a ader&ecirc;ncia dos alunos a eles.</p>','\n',char(10)),'<p>Os principais obst&aacute;culos estiveram no entendimento sobre a melhor forma de auxiliar os alunos dos cursos em suas d&uacute;vidas e dificuldades, de forma que seu aprendizado seja m&aacute;ximo.</p>','<p style="text-align: left;">Esperava-se a capacita&ccedil;&atilde;o de 50 alunos em intelig&ecirc;ncia artificial com &ecirc;nfase em sistema de recomenda&ccedil;&atilde;o. Atrav&eacute;s dos esfor&ccedil;os gerais empenhados, 140 alunos foram capacitados no primeiro m&oacute;dulo do curso. Portanto, pode-se afirmar que, durante o per&iacute;odo de vig&ecirc;ncia da bolsa, os resultados obtidos est&atilde;o em conformidade com aqueles esperados. Al&eacute;m disso, h&aacute; satisfa&ccedil;&atilde;o, tamb&eacute;m, no curso de Explora&ccedil;&atilde;o de Dados com Pandas, tendo em vista que foram disponibilizados conte&uacute;dos diversos para maior aproveitamento do curso para todas as turmas, de modo que foram obtidos retornos positivos dos alunos.</p>','<p>Nas atividades de desenvolvimento, foram alcan&ccedil;ados resultados na prepara&ccedil;&atilde;o do ambiente de desenvolvimento para futuros esfor&ccedil;os na manuten&ccedil;&atilde;o e inova&ccedil;&atilde;o dos servi&ccedil;os prestados pelo laborat&oacute;rio Comais atrav&eacute;s de seu website. Fora isso, a ferramenta de aux&iacute;lio e automa&ccedil;&atilde;o de gerenciamento de turmas no Google Classroom deve ser entregue com uma vers&atilde;o est&aacute;vel ainda dentro do per&iacute;odo de vig&ecirc;ncia da bolsa.</p>','<p>Pode-se concluir que os resultados esperados foram atingidos, na medida do desenvolvimento do principal objetivo da bolsa, que foi o suporte na forma&ccedil;&atilde;o de recursos humanos na &aacute;rea de Intelig&ecirc;ncia Artificial, com foco em Sistema de Recomenda&ccedil;&atilde;o, tendo em vista que o retorno positivo e aprova&ccedil;&atilde;o dos alunos contou com n&uacute;meros maiores do que o que consta como objetivo no plano de trabalho inicial. Fora isso, outras necessidades de apoio ao laborat&oacute;rio, que surgiram durante a bolsa, foram resolvidos de maneira satisfat&oacute;ria.</p>','2024-01-31','2024-02-01','','docs/Relatorio_final - Formação em recursos humanos na área de .docx',7);
INSERT INTO website_relatoriofinal VALUES(3,'<p>Inicialmente, foram disponibilizadas 100 vagas paraparticipantes. No entanto, devido ao sucesso da divulga&ccedil;&atilde;o do curso e &agrave;crescente demanda, a decis&atilde;o foi tomada de triplicar o n&uacute;mero de vagas.Assim, o curso matriculou um total de 300 alunos. Este aumento substancialno n&uacute;mero de participantes demonstra um interesse significativo no curso ena tem&aacute;tica de Intelig&ecirc;ncia Artificial e Sistemas de Recomenda&ccedil;&atilde;o.Dos 300 alunos que se inscreveram no curso, 225 deram in&iacute;cio&agrave;s aulas. Isso equivale a uma impressionante taxa de participa&ccedil;&atilde;o inicial de75%. Evidencia-se, assim, que uma parcela significativa dos alunos est&aacute;demonstrando comprometimento desde o in&iacute;cio do curso. Dos alunos queiniciaram o curso, 140 deles atingiram a nota necess&aacute;ria para a certifica&ccedil;&atilde;oat&eacute; a presente data. Isso equivale a 62,2% dos participantes quecome&ccedil;aram o curso. Esse n&uacute;mero demonstra um desempenho s&oacute;lido porparte dos alunos que est&atilde;o se dedicando ao curso</p>','<p>A ferramenta estudada inicialmente, Jina.ai, tomou um tempo demasiado e sua instabilidade&nbsp;impediu que fosse objeto do curso de sistemas de recomenda&ccedil;&atilde;o. Al&eacute;m disso, as a&ccedil;&otilde;es de&nbsp;grava&ccedil;&atilde;o de videoaulas, com sua edi&ccedil;&atilde;o, tomaram muito mais tempo do que o previsto&nbsp;inicialmente. A aus&ecirc;ncia de um local apropriado (est&uacute;dio) para grava&ccedil;&atilde;o destas aulas&nbsp;prejudicou a qualidade das aulas.<br>&Eacute; importante acrescentar que o engajamento dos alunos nos cursos tamb&eacute;m foram desafios,&nbsp;apesar da implementa&ccedil;&atilde;o de diferentes estrat&eacute;gias. Para combater essa dificuldade,&nbsp;promovemos encontros s&iacute;ncronos por meio de transmiss&otilde;es ao vivo, buscando criar uma&nbsp;intera&ccedil;&atilde;o mais pr&oacute;xima e personalizada. No entanto, mesmo com essa abordagem,&nbsp;enfrentamos desafios relacionados &agrave; falta de intera&ccedil;&atilde;o social entre os alunos. Apesar de&nbsp;diversas tentativas de engajamento, percebemos a necessidade cont&iacute;nua de inova&ccedil;&atilde;o nas&nbsp;estrat&eacute;gias adotadas para estimular a participa&ccedil;&atilde;o ativa e garantir uma experi&ecirc;ncia educacional&nbsp;mais envolvente.</p>',replace('<p>Diante da avalia&ccedil;&atilde;o recebida, podemos concluir que a execu&ccedil;&atilde;o do projeto do curso foi bastante bem-sucedida. Diversos aspectos se destacam positivamente, indicando uma realiza&ccedil;&atilde;o eficaz e bem planejada.</p>\n<p>Primeiramente, a satisfa&ccedil;&atilde;o geral dos alunos com o curso &eacute; um indicador claro de que as expectativas foram atendidas ou at&eacute; superadas. Isso reflete um excelente planejamento e execu&ccedil;&atilde;o, aspectos fundamentais para o sucesso de qualquer projeto educacional.</p>\n<p>A qualidade do ensino, evidenciada pelos elogios aos instrutores e aos materiais did&aacute;ticos, sugere uma escolha acertada de profissionais e um desenvolvimento eficaz de conte&uacute;do. Isso &eacute; crucial, pois a qualidade do ensino &eacute; um pilar central na educa&ccedil;&atilde;o.</p>\n<p>O curso tamb&eacute;m parece ter sido eficiente em atender &agrave;s necessidades e interesses dos alunos, como demonstrado pelo interesse expresso em t&oacute;picos avan&ccedil;ados e tecnologias espec&iacute;ficas. Isso mostra que o curso foi relevante e alinhado com as expectativas dos alunos, um indicador chave de sucesso.</p>\n<p>Al&eacute;m disso, a recep&ccedil;&atilde;o de feedbacks construtivos e sugest&otilde;es para melhorias &eacute; um sinal positivo de engajamento dos alunos. Isso fornece uma base s&oacute;lida para aprimoramentos cont&iacute;nuos e para o desenvolvimento de novos conte&uacute;dos, garantindo que o curso permane&ccedil;a atualizado e alinhado com as tend&ecirc;ncias do campo.</p>\n<p>Por fim, a disposi&ccedil;&atilde;o dos alunos em recomendar o curso a outras pessoas &eacute; um forte indicativo de seu sucesso e valor. A confian&ccedil;a e o apre&ccedil;o demonstrados pelos alunos refletem a alta qualidade e o impacto positivo do curso.</p>\n<p>Em resumo, a execu&ccedil;&atilde;o do projeto do curso pode ser avaliada como altamente eficiente e eficaz. Enquanto os objetivos principais foram claramente alcan&ccedil;ados, com um curso que educou e motivou, existem sempre oportunidades para refinamentos e expans&otilde;es, visando aprimorar ainda mais a experi&ecirc;ncia de aprendizado e a relev&acirc;ncia do programa.</p>','\n',char(10)),'<p>&Uacute;ltima bolsa no total de 14.</p>','<p>A &aacute;rea de Intelig&ecirc;ncia Artificial est&aacute; passando por um not&aacute;vel desenvolvimento neste&nbsp;momento. Entre suas diversas sub&aacute;reas, os sistemas de recomenda&ccedil;&atilde;o destacam-se como&nbsp;parte essencial, uma vez que est&atilde;o presentes no cotidiano dos usu&aacute;rios em renomadas&nbsp;plataformas do com&eacute;rcio eletr&ocirc;nico, como amazon.com, at&eacute; mesmo em servi&ccedil;os de&nbsp;entretenimento, como netflix.com. O projeto em quest&atilde;o buscou n&atilde;o apenas contribuir com o&nbsp;ensino da mat&eacute;ria de sistemas de recomenda&ccedil;&atilde;o, mas tamb&eacute;m preencher uma lacuna&nbsp;identificada, visto que h&aacute; escassez de materiais de qualidade em portugu&ecirc;s brasileiro sobre o&nbsp;tema. Dessa forma, a principal contribui&ccedil;&atilde;o do projeto reside na dissemina&ccedil;&atilde;o de&nbsp;conhecimento especializado e de alto n&iacute;vel na &aacute;rea de sistemas de recomenda&ccedil;&atilde;o. Ao abordar&nbsp;a car&ecirc;ncia de recursos educacionais em portugu&ecirc;s brasileiro, o projeto visou tornar esse campo&nbsp;de estudo mais acess&iacute;vel e compreens&iacute;vel para estudantes e profissionais interessados.&nbsp;Ademais, a disponibilidade de material educativo de qualidade pode incentivar o avan&ccedil;o da&nbsp;pesquisa e desenvolvimento local nesse campo promissor da Intelig&ecirc;ncia Artificial.</p>','2024-01-31','2024-02-29','','docs/Relatorio_final - FORMAÇÃO DE RECURSOS HUMANOS NA ÁREA DE .docx',2);
INSERT INTO website_relatoriofinal VALUES(4,replace('<p>O curso "Explora&ccedil;&atilde;o de Dados com Pandas", oferecido pela Universidade Federal do Tocantins, alcan&ccedil;ou significativos resultados ao capacitar alunos do Mestrado e Doutorado em Governan&ccedil;a e Transforma&ccedil;&atilde;o Digital em t&eacute;cnicas avan&ccedil;adas de manipula&ccedil;&atilde;o e an&aacute;lise de dados usando a biblioteca Pandas do Python. O programa se concentrou em tr&ecirc;s objetivos principais: o desenvolvimento t&eacute;cnico no uso do Pandas para manipula&ccedil;&atilde;o de dados, a realiza&ccedil;&atilde;o de an&aacute;lises explorat&oacute;rias para detectar padr&otilde;es e tend&ecirc;ncias, e a prepara&ccedil;&atilde;o dos alunos para aplicar esses conhecimentos em an&aacute;lises mais complexas, como modelagem estat&iacute;stica e aprendizado de m&aacute;quina.</p>\n<p>O feedback dos participantes revelou uma satisfa&ccedil;&atilde;o total, com 100% dos alunos relatando grande satisfa&ccedil;&atilde;o com a clareza e objetividade do conte&uacute;do apresentado. Os alunos demonstraram compet&ecirc;ncias pr&aacute;ticas efetivas na aplica&ccedil;&atilde;o dos ensinamentos em projetos que simulavam cen&aacute;rios reais, refletindo a aplicabilidade direta do aprendizado em ambientes profissionais e acad&ecirc;micos. Ademais, a forte recomenda&ccedil;&atilde;o do curso por todos os participantes sublinha seu sucesso e relev&acirc;ncia, confirmando que o curso n&atilde;o s&oacute; atendeu, mas superou as expectativas, equipando os alunos com habilidades essenciais para seus futuros desafios profissionais.</p>','\n',char(10)),'<p>Manter o engajamento e a motiva&ccedil;&atilde;o em um curso totalmente online pode ser desafiador. A falta de intera&ccedil;&atilde;o face-a-face pode diminuir a din&acirc;mica de grupo e a colabora&ccedil;&atilde;o entre os alunos, aspectos que s&atilde;o muitas vezes vitais para um aprendizado efetivo.</p>',replace('<div class="flex-shrink-0 flex flex-col relative items-end">\n<div>\n<div class="pt-0">\n<div class="gizmo-bot-avatar flex h-8 w-8 items-center justify-center overflow-hidden rounded-full">\n<div class="relative p-1 rounded-sm flex items-center justify-center bg-token-main-surface-primary text-token-text-primary h-8 w-8">&nbsp;</div>\n</div>\n</div>\n</div>\n</div>\n<div class="group/conversation-turn relative flex w-full min-w-0 flex-col agent-turn">\n<div class="flex-col gap-1 md:gap-3">\n<div class="flex max-w-full flex-col flex-grow">\n<div class="min-h-[20px] text-message flex w-full flex-col items-end gap-2 whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 overflow-x-auto" dir="auto" data-message-author-role="assistant" data-message-id="c2df6845-d6b6-42ee-bc67-05a34e65acc6">\n<div class="flex w-full flex-col gap-1 empty:hidden first:pt-[3px]">\n<div class="markdown prose w-full break-words dark:prose-invert dark">\n<p>O curso "Explora&ccedil;&atilde;o de Dados com Pandas" alcan&ccedil;ou excelentes resultados, com alta satisfa&ccedil;&atilde;o e alinhamento entre os resultados esperados e alcan&ccedil;ados, embora tenha espa&ccedil;o para ajustes na relev&acirc;ncia dos t&oacute;picos para alguns participantes.</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>','\n',char(10)),'<p>--</p>',replace('<div class="flex-shrink-0 flex flex-col relative items-end">\n<div>\n<div class="pt-0">\n<div class="gizmo-bot-avatar flex h-8 w-8 items-center justify-center overflow-hidden rounded-full">\n<div class="relative p-1 rounded-sm flex items-center justify-center bg-token-main-surface-primary text-token-text-primary h-8 w-8">&nbsp;</div>\n</div>\n</div>\n</div>\n</div>\n<div class="group/conversation-turn relative flex w-full min-w-0 flex-col agent-turn">\n<div class="flex-col gap-1 md:gap-3">\n<div class="flex max-w-full flex-col flex-grow">\n<div class="min-h-[20px] text-message flex w-full flex-col items-end gap-2 whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 overflow-x-auto" dir="auto" data-message-author-role="assistant" data-message-id="53ee2337-48c0-4dcb-bb00-2e6e73769bf5">\n<div class="flex w-full flex-col gap-1 empty:hidden first:pt-[3px]">\n<div class="markdown prose w-full break-words dark:prose-invert dark">\n<p>O curso "Explora&ccedil;&atilde;o de Dados com Pandas" oferecido pela Universidade Federal do Tocantins demonstrou ser extremamente eficaz, atendendo &agrave;s expectativas e at&eacute; superando-as em muitos aspectos. A totalidade dos alunos expressou um alto grau de satisfa&ccedil;&atilde;o, destacando a clareza e objetividade do conte&uacute;do apresentado, bem como a profundidade e aplicabilidade dos conhecimentos adquiridos. A capacidade de aplicar as t&eacute;cnicas aprendidas em cen&aacute;rios pr&aacute;ticos de dados foi especialmente valorizada, indicando o sucesso do curso em equipar os alunos com as habilidades necess&aacute;rias para enfrentar desafios reais na ci&ecirc;ncia de dados.</p>\n<p>No entanto, o feedback tamb&eacute;m aponta para a necessidade de ajustar o curso para garantir a relev&acirc;ncia de todos os t&oacute;picos abordados para cada participante, sugerindo uma personaliza&ccedil;&atilde;o mais detalhada ou a inclus&atilde;o de m&oacute;dulos opcionais que possam atender a uma gama mais ampla de interesses e necessidades profissionais. Esta ser&aacute; uma &aacute;rea importante para futuras melhorias, com o objetivo de maximizar o valor do curso para todos os envolvidos.</p>\n<p>Em conclus&atilde;o, o curso provou ser uma iniciativa bem-sucedida, deixando uma impress&atilde;o positiva e impactante nos alunos, preparando-os efetivamente para contribui&ccedil;&otilde;es significativas em seus campos de atua&ccedil;&atilde;</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>','\n',char(10)),'2024-07-01','2024-08-09','','docs/Relatorio_final - Governança Digital e Modelagem Computaci.docx',8);
